		me._floor_plan_img_mobile.ggCalculateFloorplanDimInDeg=function(mapDetails) {
			var mapAR = mapDetails['width'] / mapDetails['height'];
			var tileInDeg = 360.0 / Math.pow(2, 7);
			if (mapDetails['width'] >= mapDetails['height']) {
				var tmpWidth = mapDetails['width'];
				while (tmpWidth > 256) {
					tmpWidth /= 2;
				}
				me._floor_plan_img_mobile.mapWidthInDeg = tileInDeg * (tmpWidth / 256);
				me._floor_plan_img_mobile.mapHeightInDeg = me._floor_plan_img_mobile.mapWidthInDeg / mapAR;
			} else {
				var tmpHeight = mapDetails['height'];
				while (tmpHeight > 256) {
					tmpHeight /= 2;
				}
				me._floor_plan_img_mobile.mapHeightInDeg = tileInDeg * (tmpHeight / 256);
				me._floor_plan_img_mobile.mapWidthInDeg = me._floor_plan_img_mobile.mapHeightInDeg * mapAR;
			}
		}
		me._floor_plan_img_mobile.ggInCheckBounds=false;
		me._floor_plan_img_mobile.ggCheckBounds=function(mapDetails) {
			if (me._floor_plan_img_mobile.ggInCheckBounds) return;
			me._floor_plan_img_mobile.ggInCheckBounds = true;
			var mapCenter = me._floor_plan_img_mobile.ggMap.getCenter();
			var currentZoom = me._floor_plan_img_mobile.ggMap.getZoom();
			var pixelInDeg = 360.0 / (Math.pow(2, currentZoom) * 256)
			var xOffset = (me._floor_plan_img_mobile.clientWidth / 2.0) * pixelInDeg;
			var yOffset = (me._floor_plan_img_mobile.clientHeight / 2.0) * pixelInDeg;
			var x = mapCenter.lng;
			var y = mapCenter.lat;
			var xTemp = x;
			var yTemp = y;
			if (me._floor_plan_img_mobile.mapWidthInDeg < me._floor_plan_img_mobile.clientWidth * pixelInDeg) {
				var xMargin = (me._floor_plan_img_mobile.clientWidth * pixelInDeg - me._floor_plan_img_mobile.mapWidthInDeg) / 2;
				if (x < me._floor_plan_img_mobile.mapWidthInDeg / 2 - xMargin) x = me._floor_plan_img_mobile.mapWidthInDeg / 2 - xMargin;
				if (x > me._floor_plan_img_mobile.mapWidthInDeg / 2 + xMargin) x = me._floor_plan_img_mobile.mapWidthInDeg / 2 + xMargin;
			} else {
				if (x > me._floor_plan_img_mobile.mapWidthInDeg - xOffset) x = me._floor_plan_img_mobile.mapWidthInDeg - xOffset;
				if (x < xOffset) x = xOffset;
			}
			if (me._floor_plan_img_mobile.mapHeightInDeg < me._floor_plan_img_mobile.clientHeight * pixelInDeg) {
				var yMargin = (me._floor_plan_img_mobile.clientHeight * pixelInDeg - me._floor_plan_img_mobile.mapHeightInDeg) / 2;
				if (y < -me._floor_plan_img_mobile.mapHeightInDeg / 2 - yMargin) y = -me._floor_plan_img_mobile.mapHeightInDeg / 2 - yMargin;
				if (y > -me._floor_plan_img_mobile.mapHeightInDeg / 2 + yMargin) y = -me._floor_plan_img_mobile.mapHeightInDeg / 2 + yMargin;
			} else {
				if (y < -me._floor_plan_img_mobile.mapHeightInDeg + yOffset) y = -me._floor_plan_img_mobile.mapHeightInDeg + yOffset;
				if (y > -yOffset) y = -yOffset;
			}
			if (x != xTemp || y != yTemp) {
				var newCenter = L.latLng(y, x);
				me._floor_plan_img_mobile.ggMap.setView(newCenter, me._floor_plan_img_mobile.ggMap.getZoom(), {animate: false});
			}
			me._floor_plan_img_mobile.ggInCheckBounds = false;
		}
